class SidebarCustomStyle {
  refs = {
    ha: null,
    main: null,
    drawer: null
  }

  constructor() {
    try {
      this.refs.ha = document.querySelector("home-assistant")
      this.refs.main = this.refs.ha?.shadowRoot.querySelector("home-assistant-main")?.shadowRoot
      this.refs.drawer = this.refs.main?.querySelector("ha-drawer")?.shadowRoot
      this.run()
    } catch (ex) { }
  }

  run = () => {
    setTimeout(() => {
      try {
        this.refs.drawer.querySelector("aside").style.borderRightStyle = "unset"
      } catch(error) { }
    }, 1)
  }
}

Promise.resolve(customElements.whenDefined('ha-panel-lovelace')).then(() => {
  if (document.querySelector('home-assistant').hass.themes['theme'].includes("LCARS")) {
    console.info(`%c  LCARS - REMOVING SIDEBAR BORDER  `, "color: #ff9800; font-weight: bold; background-color: black")
    window.customStyle = new SidebarCustomStyle()
  }
})

class SidebarSound {
  refsMenu = {
    ha: null,
    main: null,
    drawer: null,
    sidebar: null,
    menu: null
  }

  constructor() {
    try {
      this.refsMenu.ha = document.querySelector("home-assistant")
      this.refsMenu.main = this.refsMenu.ha?.shadowRoot.querySelector("home-assistant-main")?.shadowRoot
      this.refsMenu.drawer = this.refsMenu.main?.querySelector("ha-drawer")
      this.refsMenu.sidebar = this.refsMenu.drawer?.querySelector("ha-sidebar")?.shadowRoot
      this.runMenu()
    } catch (ex) { }
  }

  runMenu = () => {
    this.refsMenu.sidebar.addEventListener('click', e => {
      if (document.querySelector('home-assistant').hass.states['input_boolean.lcars_sound'].state == 'on') {
        if (e.target.matches("ha-icon-button")) {
          menuExpand.play()
        } else if (e.target.matches("PAPER-ICON-ITEM") ||
                  e.target.matches("HA-ICON") ||
                  e.target.matches("HA-SVG-ICON") ||
                  e.target.matches("SPAN")) {
          navBeep.play()
        }
      }
    })
  }
}

class DashSound {
  refsButton = {
    ha: null,
    main: null,
    drawer: null,
    resolver: null,
    lovelace: null,
    root: null,
    view: null,
    hui: null,
    masonry: null,
    columns: null,
    columnsList: null
  }

  constructor() {
    try {
      this.refsButton.ha = document.querySelector("home-assistant")
      this.refsButton.main = this.refsButton.ha?.shadowRoot.querySelector("home-assistant-main")?.shadowRoot
      this.refsButton.drawer = this.refsButton.main?.querySelector("ha-drawer")
      this.refsButton.resolver = this.refsButton.drawer?.querySelector("partial-panel-resolver")
      this.runButton()
    } catch (ex) { }
  }

  runButton = () => {
    this.refsButton.resolver.addEventListener('click', e => {
      if (e.target.matches("HA-PANEL-LOVELACE") && document.querySelector('home-assistant').hass.states['input_boolean.lcars_sound'].state == 'on' ) {
        btnBeep.play()
      }
    })
  }
}

Promise.all([
  customElements.whenDefined('ha-panel-lovelace'),
  customElements.whenDefined('hui-masonry-view')
]).then(() => {
  if (document.querySelector('home-assistant').hass.themes['theme'].includes("LCARS")) {
    console.info(`%c  LCARS - ADDING AUDIO  `, "color: #ff9800; font-weight: bold; background-color: black")
    const sounds = [new SidebarSound(), new DashSound()]
  }
})



